import React from "react";
import {Image, Popup, Rating} from 'semantic-ui-react';

function element(props){
    console.log(props);
    let src='../img/';
    return(
        
        <div id="element">
            <Popup
                trigger={<Image  src={`${src}/tayara.png`} size="tiny"></Image>}
                on='click'
                hideOnScroll>
                <Popup.Content>
                        <span>
                        <p>{props.data.text}</p>
                        <Rating defaultRating={props.data.rate} maxRating={5} disabled />
                        </span>
                </Popup.Content>
            </Popup>
        </div>
    )
}


export default element;
